import React from 'react'

import ('./PicsNNews.css')

export default class PicsNNews extends React.Component {
  constructor(props) {
    super(props)
    this.state = {}
  }
  render() {
    return(
      <div className="picsNNews">
        <div className="Pics"></div>
        <div className="News"></div>
        <div className="Dunno"></div>
      </div>
    )
  }
}
